definitions.definition:
A white crystalline hexose (HO.CH2.(CHOH)4.CH2.OH) of a sweet taste obtained from a so-called manna, the dried sap of the flowering ash (
               Fraxinus ornus
            ); -- called also mannite, and hydroxy hexane.  Cf. Dulcite.  It is used in pharmacy as excipient and diluent for solids and liquids.  It is also used as a food additive for anti-caking properties, or as a sweetener, and, illegally, to "cut" (dilute) illegal drugs such as cocaine or heroin.

the display of the images captured on a motion picture1}, presented to the eye in very rapid succession by projection from a special apparatus (a 
               movie projector
            ), with shows some or all of the objects in the picture represented in changing positions, producing, by persistence of vision, the optical effect of a continuous picture in which the objects appear to move as they did in the original scene.
